import React from 'react'
import Layouts from '../Layouts/Layouts'
import student from './../assests/images/Icons/student.png';
import HomeIcons from '../Components/HomeIcons';
import teacher from './../assests/images/Icons/teacher.png';

function Home() {  
  const homeData = [
    {src: student, title: 'Add Student', toRoute: '/s/addStudeent' ,category:'student'},
    {src: student, title: 'Update Student Data', toRoute: '/s/addStudeent',category:'student'},
    {src: teacher, title: 'Add teacher', toRoute: '/s/addStudeent',category:'teacher'},
    {src: student, title: 'Update Teacher Data', toRoute: '/s/addStudeent',category:'teachar'},
    {src: student, title: 'Create Projects', toRoute: '/s/addStudeent',category:'project'},
    {src: student, title: 'Projects Groups', toRoute: '/s/addStudeent',},
    {src: student, title: 'Research paper', toRoute: '/s/addStudeent'},
    {src: student, title: 'Allocate Guide', toRoute: '/s/addStudeent'},
    {src: student, title: 'Allocate Reviewer', toRoute: '/s/addStudeent'}
  ]

  return (
    <Layouts>
      <div className='grid grid-cols-1 lg:grid-col-3 md:grid-cols-4 items-center justify-between gap-10 p-10' style={{ zIndex: 0 }}>
        {homeData.map((data, key) => (
          <div key={key}>
            <HomeIcons src={data.src} title={data.title} toRoute={data.toRoute} />
          </div>
        ))}
      </div>
    </Layouts>
  )
}

export default Home;
